const alert_types = {
  INFO: 'INFO',
  SUCCESS: 'SUCCESS',
  WARNING: 'WARNING',
  DANGER: 'DANGER',
};

export default alert_types;

type AlertTypeType = {
  [key: string]: string,
};
export type { AlertTypeType };
